import React from "react";

import { motion } from "framer-motion";

import "./Header.scss";

const Header = () => {
  return (
    <div className="app__header app__container app__flex">
      <div className="app__header-text">
        <h1 className="head-text">
          <motion.div
            whileInView={{ x: [-100, 0], opacity: [0, 1] }}
            transition={{ duration: 3 }}
          >
            Creating Extraordinary
          </motion.div>
          <motion.div
            whileInView={{ x: [100, 0], opacity: [0, 1] }}
            transition={{ duration: 3 }}
          >
            Enhanced Experiences
          </motion.div>
        </h1>
        <p className="p-text" style={{ textAlign: "center" }}>
          Experienced in web development and cyber security from Manchester
        </p>
      </div>
      <div className="app__header-scroll-content">
        <div className="app__header-scroll">
          <span></span>
        </div>
        <a href="#">
          <p className="p-text">Scroll To Projects</p>
        </a>
      </div>
    </div>
  );
};

export default Header;
